import React from "react";
import styles from "./styles.module.css";

const movies = [
  {
    name: "Baby (Telugu)",
    rating: 4,
    image: "", // Replace with the image URL
  },
  {
    name: "Oppenheimer (English)",
    rating: 4.2,
    image: "https://www.filmibeat.com/img/190x100x237/popcorn/movie_posters/baby-20230711172441-21800.jpg", // Replace with the image URL
  },
  {
    name: "Barbie (2023)",
    rating: 3.5,
    image: "https://example.com/barbie_2023.jpg", // Replace with the image URL
  },
  {
    name: "Bro (Telugu)",
    rating: 4.5,
    image: "https://example.com/bro_telugu.jpg", // Replace with the image URL
  },
  {
    name: "Rocky Aur Rani (Hindi)",
    rating: 2.5,
    image: "https://example.com/rocky_aur_rani_hindi.jpg", // Replace with the image URL
  },
];

const Home = () => {
  return (
    <div className={styles.homeContainer}>
      <h1 className={styles.appName}>Movie Club</h1>
      <div className={styles.movieList}>
        {movies.map((movie) => (
          <div key={movie.name} className={styles.movieItem}>
            <img src={movie.image} alt={movie.name} className={styles.movieImage} />
            <h2 className={styles.movieName}>{movie.name}</h2>
            <p className={styles.movieRating}>Rating: {movie.rating}</p>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Home;
